import React from 'react'
import './projects.css'
import project_data from '../../Data/project.json'

export const Projects = (props) => {
    return(
    <>
    <div className='projects'>
        <div className='title'>Projects</div>
        <div className='description'>projects that I lead...</div>

        {
            publication_data.map((data, index) => (
            <div className='eachproject'>
                <div className='project_image'></div>
                <div className='project_title'></div>
                <div className='project_description'></div>
            </div>
            ))
        }


    </div>
    </>
    )
}
